import { React, useState, useEffect } from "react";

const List = () => {
  const [counter, setCounter] = useState(0);

  const onPlusClick = () => {
    setCounter(counter + 1);
  };

  const onMinClick = () => {
    setCounter(counter - 1);
  };
  return (
    <div>
      <button onClick={onPlusClick}>+</button>
      {counter}
      <button onClick={onMinClick}>-</button>
    </div>
  );
};

export default List;
